{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/daynaleereid/bellabeat-case-study?scriptVersionId=104121628\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"3bdf734d","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2022-08-20T21:02:59.678716Z","iopub.status.busy":"2022-08-20T21:02:59.644248Z","iopub.status.idle":"2022-08-20T21:02:59.688653Z"},"papermill":{"duration":0.006599,"end_time":"2022-08-24T18:49:44.690661","exception":false,"start_time":"2022-08-24T18:49:44.684062","status":"completed"},"tags":[]},"source":["# BellaBeat\n","#### Urška Sršen and Sando Mur founded Bellabeat, a high-tech company that manufactures health-focused smart products. Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around the world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n","# Business Task\n","#### Focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. Identify insights to help guide marketing strategy for the company.The guiding questions:1. What are some trends in smart device usage? 2. How could these trends apply to Bellabeat customers? 3. How could these trends help influence Bellabeat marketing strategy?\n","#Data Source Used\n","####  FitBit Fitness Tracker Data (CC0: Public Domain, dataset made available through Mobius): This Kaggle data set contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits\n","# Guiding Questions\n","#### 1. What are some trends in smart device usage?\n","#### 2. How could these trends apply to Bellabeat customers?\n","#### 3. How could these trends help influence Bellabeat marketing strategy?\n","#Loading Packages"]},{"cell_type":"code","execution_count":1,"id":"55f6d154","metadata":{"execution":{"iopub.execute_input":"2022-08-24T18:49:44.708143Z","iopub.status.busy":"2022-08-24T18:49:44.705362Z","iopub.status.idle":"2022-08-24T18:49:46.234166Z","shell.execute_reply":"2022-08-24T18:49:46.232262Z"},"papermill":{"duration":1.540175,"end_time":"2022-08-24T18:49:46.237826","exception":false,"start_time":"2022-08-24T18:49:44.697651","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching pac